// import "./index.css";

function App() {
    return (
        <AuthProvider>
            <Router>
                <Routes>
                <Route path="/" element={<Login />} />
                <Route path="/tovars" element={<Tovar />} /> {/* <-- добавь это */}
                <Route path="/tovar/:id" element={<Tovar />} />
                </Routes>
            </Router>
        </AuthProvider>
    );
}

export default App;
